(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[7765],{17765:function(e){"use strict";e.exports=JSON.parse('{"md":"\\n# Audit\\n\\n`Audit` contains the details of an operation performed on an entity.\\n\\n| Field | Description | Type | Reference | Nullable | Deprecated |\\n|-------|-------------|------|-----------|----------|------------|\\n| id | Unique audit id for this operation | ID | [ID](/api-docs/id) | No | No |\\n| user | Person performing the operation, can be undefined if the system has performed the operation instead | OrgUser | [OrgUser](/api-docs/org-user) | Yes | No |\\n| owner | Operation owner | OperationOwner | [OperationOwner](/api-docs/operation-owner) | No | No |\\n| model_id | Entity on which the operation was performed | ID | [ID](/api-docs/id) | No | No |\\n| model | Name of the model | String | [String](/api-docs/string) | No | No |\\n| model_persisting_id | Model&#039;s persisting id | String | [String](/api-docs/string) | No | No |\\n| parent_model_ids | Model extends from | List[ID] | [ID](/api-docs/id) | No | No |\\n| action | Action Preformed | AuditAction | [AuditAction](/api-docs/audit-action) | No | No |\\n| method | Method in which the action was performed | GQLMethod | [GQLMethod](/api-docs/gql-method) | No | No |\\n| comments | Optional user comments linked to this operation | String | [String](/api-docs/string) | Yes | No |\\n| connected_models | Models directly connected to (or influenced by) this operation | List[OperationConnectedModel] | [OperationConnectedModel](/api-docs/operation-connected-model) | No | No |\\n| created_at | The date the `Audit` was created | DateTime | [DateTime](/api-docs/date-time) | No | No |\\n\\n## Queries\\n\\n*Queries provide a function on the graph to access Audit entities. This should be considered the same as RESTful \'GET\'*\\n\\n---\\n\\n### Get History For Entities\\n\\n```graphql\\ngetHistoryForEntities(entities: [ID]!): [Audit]\\n\\n```\\n\\nGet the history for all entities\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| entities | Any valid list of entity ids | List[ID] | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| List[Audit] | [Audit](/api-docs/audit) |\\n\\n\\n\\n\\n"}')}}]);